Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    val sc = spark.sparkContext

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = sc.textFile("onsite_data.txt")

    // Load top frequent queries
    val topQueries: JavaRDD[String] = sc.textFile("top_queries.txt")

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = sc.broadcast(topQueries.collect())

    // Initialize cache
    val cache: Map[String, Long] = mutable.Map()

    // Process onsite data
    val hitRate = onsiteData.map(line => {
      val query = line.split(" ")(0)
      val timestamp = line.split(" ")(1).toLong

      if (broadcastTopQueries.value.contains(query)) {
        if (!cache.contains(query) || timestamp - cache(query) > 12 * 60 * 60 * 1000) {
          // Cache miss
          cache(query) = timestamp
          (query, false)
        } else {
          // Cache hit
          (query, true)
        }
      } else {
        // Query not in top queries
        (query, false)
      }
    }).filter(_._2).count().toDouble / onsiteData.count()

    println(s"Hit rate: $hitRate")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from text files. It then broadcasts the top queries to all nodes in the cluster. The cache is initialized as an empty mutable map.

The job then processes the onsite data by iterating over each line and extracting the query and timestamp. If the query is in the top queries, the job checks if it is in the cache and if the timestamp is within the 12-hour window. If it is not in the cache or the timestamp is outside the window, it is a cache miss and the query is added to the cache with the current timestamp. If it is in the cache and the timestamp is within the window, it is a cache hit.

The job then filters out the queries that are not in the top queries and calculates the hit rate by dividing the number of cache hits by the total number of queries in the onsite data. The hit rate is printed to the console.

