Adaptive Cards in Microsoft Teams do not directly support changing the background color of the entire card. However, you can change the background color of individual elements within the card, such as containers or columns.

Here's an example of how to change the background color of a container within an Adaptive Card:
```json
{
    "type": "AdaptiveCard",
    "body": [
        {
            "type": "Container",
            "style": "emphasis",
            "items": [
                {
                    "type": "TextBlock",
                    "text": "This is a container with a background color"
                }
            ],
            "backgroundImage": {
                "url": "data:image/png;base64,iVBORw0KGg...."
            }
        }
    ],
    "actions": [],
    "$schema": "http://adaptivecards.io/schemas/adaptive-card.json",
    "version": "1.0"
}
```
In the above example, the `backgroundImage` property is used to set the background color of the container. The value of the `url` property is a base64-encoded string representing a 1x1 pixel image with the desired background color.

To generate a base64-encoded string for a specific color, you can use an online tool such as [this one](https://www.base64-image.de/). Simply enter the hex code for the desired color (e.g. "#FF0000" for red), and the tool will generate a base64-encoded string that you can use in the `backgroundImage` property.

Note that this method only works for containers and columns within an Adaptive Card, and not for the entire card itself. If you need to change the background color of the entire card, you may need to consider using a different type of card or a custom solution.

To create a tooltip in NextJS using React Context to close the previously opened tooltip, you can follow these steps:

1. Create a TooltipContext.js file:

```javascript
import React from 'react';

const TooltipContext = React.createContext();

export const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = React.useState(null);

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  const openTooltip = (id) => {
    setActiveTooltip(id);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, closeTooltip, openTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => React.useContext(TooltipContext);
```

2. Wrap your application with the `TooltipProvider` in `_app.js`:

```javascript
import '../styles/globals.css';
import { TooltipProvider } from '../components/TooltipContext';

function MyApp({ Component, pageProps }) {
  return (
    <TooltipProvider>
      <Component {...pageProps} />
    </TooltipProvider>
  );
}

export default MyApp;
```

3. Create a Tooltip.js component:

```javascript
import React from 'react';
import { useTooltip } from './TooltipContext';

const Tooltip = ({ id, children }) => {
  const { activeTooltip, closeTooltip, openTooltip } = useTooltip();

  const handleMouseEnter = () => {
    openTooltip(id);
  };

  const handleMouseLeave = () => {
    closeTooltip();
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
    >
      {children}
      {activeTooltip === id && (
        <div className="tooltip">
          {/* Your tooltip content here */}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

4. Use the `Tooltip` component in your application:

```javascript
import Tooltip from '../components/Tooltip';

const MyComponent = () => {
  return (
    <div>
      <Tooltip id="tooltip1">
        <span>Hover over me</span>
      </Tooltip>
      <Tooltip id="tooltip2">
        <span>Hover over me</span>
      </Tooltip>
    </div>
  );
};

export default MyComponent;
```

Now, when you hover over a tooltip, it will open, and when you hover over another tooltip, the previously opened tooltip will close.
